import React from "react";
import { sidebarItems } from "../../data/data";
import { Link } from "react-router-dom";
import logo from "../../assets/bx_bxs-store-alt.svg";
import {
  Items,
  Item,
  Wrapper,
  Logo,
} from "./SidebarElements";

const Sidebar = () => {
  const style = {
    color: "#EA7C69",
  }
  return (
    <Items>
      <Logo>
        <img src={logo} alt="logo"/>
      </Logo>
      {sidebarItems.data.map((item) => (
        <Link to={item.link}>
          <Item key={item.id}>
            <Wrapper>
              <img style={style} src={item.icon} alt={item.link} />
            </Wrapper>
          </Item>
        </Link>
      ))}
    </Items>
  );
};

export default Sidebar;
